import { Route, Routes } from 'react-router-dom';
import App from './App';
import { Pagination } from './components';

const RoutesComponent = () => {
  return (
    <Routes>
      <Route path="/pagination" element={<Pagination />} />
      <Route path="/" element={App} />
    </Routes>
  );
};

export default RoutesComponent;
